PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "track_artists" (
"id" TEXT,
  "artist_id" TEXT,
  "artist_index" INTEGER
);
CREATE TABLE IF NOT EXISTS "tracks" (
"id" TEXT,
  "streams" INTEGER,
  "title" TEXT,
  "date" TEXT,
  "album_art" TEXT
);
CREATE TABLE IF NOT EXISTS "artists" (
"artist_name" TEXT,
  "artist_id" TEXT
);
CREATE TABLE IF NOT EXISTS "buckets" (
"id" TEXT,
  "bucket" TEXT
);
COMMIT;
